import Navbar from "../components/Navbar";
import Products from "../components/Products";
export default class Index extends React.Component{

    render(){
        const products = [
            {
                title: "Hello World 1",
                description: "This is item 1",
                imgUrl: "/img/fibonacci.png"
            },
            {
                title: "Hello World 2",
                description: "This is item 1",
                imgUrl: "/img/fibonacci.png"
            },
            {
                title: "Hello World 3",
                description: "This is item 1",
                imgUrl: "/img/fibonacci.png"
            },
            {
                title: "Hello World 4",
                description: "This is item 1",
                imgUrl: "/img/fibonacci.png"
            },
            {
                title: "Hello World 5",
                description: "This is item 1",
                imgUrl: "/img/fibonacci.png"
            },
            {
                title: "Hello World 6",
                description: "This is item 1",
                imgUrl: "/img/fibonacci.png"
            },
        ];
        return(
                <React.Fragment>
                    <Navbar title="Home Page" />
                    <Products products/>
                </React.Fragment>
        );
    }
}
